import { ImCross } from 'react-icons/fa';

import { DragDropContext } from 'react-beautiful-dnd';
import './App.css';
import data from './data';

function App() {
  const[list,setList]=useState(data)
  return (
    <div className="App">
      <h2>To Do List</h2>
      <div className='section'>
        {list.map((item,index)=>{
          return(
            <div className='item'>
            <p  key={index}>{item}</p>
            </div>
          )

        })}

      </div>
    </div>
  );
}

export default App;
